DROP TABLE IF EXISTS transaction;

CREATE TABLE transaction (
	id INT,
	currency VARCHAR(3),
	method VARCHAR(7),
	amount DECIMAL(5,2),
	createdAt DATE,
	updatedAt DATE,
	status VARCHAR(7)
);


ALTER TABLE transaction
ADD COLUMN "createdAt" TIMESTAMP NOT NULL DEFAULT NOW(),
ADD COLUMN "updatedAt" TIMESTAMP NOT NULL DEFAULT NOW();

